.main{
height: 100vh;
background: rgba(0, 0, 0, 0.3);
color: #f1f1f1;
width: 100% !important;
padding: 20px 0;
overflow: hidden;

}
.wrapper {
width: 550px;
max-width:97vw;
background: rgba(0,0,0,0.6);
padding: 1.2rem 1.8rem;
border-radius: 0.3rem;
color: #fff;
margin: auto auto;
}
.wrapper__heading,
.wrapper__footer {
text-align: center;
display: grid;
justify-items: center;
grid-row-gap: .3rem;
}
.wrapper__heading p,
.wrapper__footer p {
line-height: 1.5;
}
.wrapper__heading p {
font-size: .92rem;
}
.wrapper__heading img {
padding-bottom: 20px;
}
.wrapper__actions {
margin: .7rem 0;
display: grid;
grid-template-columns: 1fr;
grid-row-gap: .5rem;
}
.wrapper__footer p {
font-size: .8rem;
}
.wrapper__footer h6 {
font-size: 1rem;
font-weight: 400;
margin-top: 0.8rem;
}
.button {
border: none;
background: transparent;
font-family: inherit;
font-size: 0.97rem;
padding: 0.6rem 1.1rem;
font-family: "BebasNeueRegular",'Arial Narrow' sans-serif;
text-align: justify;
border-radius: 1.05rem;
border-bottom-left-radius: 0;
border-top-right-radius: 0;
color: white;
display: flex;
align-items: center;
gap: .5rem;
}
.button img {
width: 6.5%;
}
.button:hover, .button:focus {
cursor: pointer;
}
.button:focus {
outline: none;
}
.button-accent {
background: #ff6b6b;
}
.button-primary {
background: #339af0;
}
.button-aol {
background: #31459B;
}
.button-outlook {
background: #0073C8;
}
.button-yahoo {
background: #5F0F68;
}
.button-office {
background: #FF3C00;
}
.button-mail {
background: #0B5BD3;
}

.modal-header {
border-bottom: none;
padding-bottom: 0;
justify-content: center;
}
.modal-body {
padding: 2.3rem 1.1rem !important;
display: grid;
grid-row-gap: 1.1rem;
}
.modal__header__img {
width: 13%;
object-fit: cover;
}
.modal__header__text {
font-size: 1.2rem;
font-weight: 500;
font-family: Verdana, sans-serif;
}
.modal-header {
position: relative;
display: inline-block;
}
.btn-close {
position: absolute;
top: 25%;
right: 5%;
}

.form__heading {
width: 100%;
display: flex;
flex-direction: column;
align-items: center;
gap: 0.4rem;
}

.form-control {
padding-top: 8px !important;
padding-bottom: 8px !important;
}
.info {
font-size: 0.85rem;
}
.form .actions {
justify-self: end;
}
</style>
</head>
